import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Link,
    Routes,
    Route
}   from 'react-router-dom';
import Blog from './Blog/BlogPage';
import BlogList from './Blog/BlogBlog';
import Projects from './ClassProjects/ClassProps';
import EventReact from './ReactEvent/Activity01-Event';

class App extends Component {
    render(){
        const{username} = this.props;
        return(
            <Router>
           <div>    
            <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
            <div class="container">
                <a class="navbar-brand" href="#!">VLOGBLOG</a>
                <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation"><span class="navbar-toggler-icon"></span></button>
                <div class="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul class="navbar-nav ms-auto mb-2 mb-lg-0">
                        <li class="nav-item"><Link to="/BlogList" class="nav-link" >Blog</Link></li>
                        <li class="nav-item"><Link to="/myblog" class="nav-link">Class Props</Link></li>
                        <li class="nav-item"><Link to="/myevents" class="nav-link">React Event</Link></li>
                    </ul>
                </div>
            </div>
        </nav>
        </div>
       
                <div>
                    <h1>React Router</h1>
                    <p>Welcome, {username}</p>
                    <Routes>
                        <Route
                        exact
                        path="/myblog"
                        element={<Blog/>}
                        ></Route>
                        <Route
                        exact
                        path="/BlogList"
                        element={<BlogList/>}
                        ></Route>
                        <Route
                        exact
                        path="/myprops"
                        element={<Projects/>}
                        ></Route>
                        <Route
                        exact
                        path="/myevents"
                        element={<EventReact/>}
                        ></Route>
                    </Routes>
                </div>
            </Router>
        )
    }
}

export default App;
